import React from 'react';
import './flightListings.css';

function FlightListings(props) {
  // const [tag, setTag] = useState('');
  // setTag('#최저가 추천');

  return (
    <div className="FlightListing">
      {props.tag && <h6 className="recommendation-tag">{props.tag}</h6>}
      <ul>
        <li>
          <time className="time-of-flight">15:50 ~ 18:15</time>
          <p className="flight-duration">직항 2시간 25분</p>
          <dl className="flight-details">
            <dt className="time-of-flight__detail">ICN-NRT, 아시아나항공</dt>
            <dd className="flight-time-duration__detail">무료수하물 1개</dd>
          </dl>
        </li>

        <li>
          <time className="time-of-flight">09:00 ~ 11:30</time>
          <p className="flight-duration">직항 2시간 30분</p>
          <dl className="flight-details">
            <dt className="time-of-flight__detail">NRT-ICN, 아시아나항공</dt>
            <dd className="fligt-time-duration__detail">무료수하물 1개</dd>
          </dl>
        </li>
      </ul>
      <div className="available-seats">9석 남음</div>
      <div className="flight-cost">362,900원</div>
    </div>
  );
}

export default FlightListings;
